import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { PersonTableComponent } from '../../components/person-table/person-table.component';
import { PersonFormComponent } from '../../components/person-form/person-form.component';

const routes: Routes = [
  { path: '', component: PersonTableComponent }, // Página inicial de pessoas
  { path: 'person-table', component: PersonTableComponent }, // Rota de listagem de pessoas
  { path: 'person-form', component: PersonFormComponent }, // Rota para o formulário de criação/edição
];

@NgModule({
  imports: [RouterModule.forChild(routes)], // Usando forChild para definir as rotas do módulo
  exports: [RouterModule]
})
export class PersonRoutingModule { }
